import React, {useState,Fragment} from "react";
import {useDispatch} from 'react-redux'
import countries from 'countries-list'



export const Shipping = () => {

    const countriesList = Object.values(countries)

    const [address, setAddress] = useState('')
    const [city, setCity] = useState('')
    const [phoneNumber, setNo] = useState('')
    const [postalCode, setPost] = useState('')
    const [Country, setCountry] = useState('')

    // const change =(e)=>{
    //     console.log(e)
    // }
    return (
        <Fragment>
            <div class="row wrapper">
                <div class="col-10 col-lg-5">
                    <form class="shadow-lg">
                        <h1 class="mb-4">Shipping Info</h1>
                        <div class="form-group">
                            <label for="address_field">Address</label>
                            <input
                                type="text"
                                id="address_field"
                                class="form-control"
                                value={address}
                                onChange={e => setAddress(e.target.value)}
                                required
                            />
                        </div>

                        <div class="form-group">
                            <label for="city_field">City</label>
                            <input
                                type="text"
                                id="city_field"
                                class="form-control"
                                onChange={e => setCity(e.target.value)}   
                                value={city}
                                required
                                />
                        </div>

                        <div class="form-group">
                            <label htmlFor="phone_field">Phone No</label>
                            <input
                                type="phone"
                                onChange={e => setNo(e.target.value)}  
                                id="phone_field"
                                class="form-control"
                                value={phoneNumber}
                                required
                            />
                        </div>

                        <div class="form-group">
                            <label for="postal_code_field">Postal Code</label>
                            <input
                                onChange={e => setPost(e.target.value)}   
                                type="number"
                                id="postal_code_field"
                                class="form-control"
                                value={postalCode}
                                required
                                />
                        </div>

                        <div class="form-group">
                            <label for="country_field">Country</label>
                            <select
                                id="country_field"
                                class="form-control"
                                value={Country}
                                onChange={e => setCountry(e.target.value)}  
                                required
                            >
                                   {countriesList.map(country=>(<option key={country.name} value={country.name}>
                                        {country.name}
                                    </option>))}

                            </select>
                        </div>

                        <button
                            id="shipping_btn"
                            type="submit"
                            class="btn btn-block py-3"
                        >
                            CONTINUE
                            </button>
                    </form>
                </div>
            </div>
            
        </Fragment>
    )
}
